import * as React from 'react';
import { Text, ScrollView ,StyleSheet} from 'react-native';
function HomeScreen() {
    return (
      <ScrollView style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <View>
          <Text style={styles.title}>Personalize your Feedly </Text>
          <Text style={styles.title}>Keep with the topic ,feeds and trends</Text>
          <Text style={styles.title}>that matter to you .All in one place</Text>
        </View>
      </ScrollView>
    );
  }
  export default HomeScreen;

  const styles = StyleSheet.create({
    title:{
      display:'flex',
      justifyContent:'center'
    }
  })
